/* eslint-disable jsx-a11y/alt-text */
import { useState, useEffect } from "react";
import "./App.css";

import {Advisor} from './components'

function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db.advisorProfileCollection.items);
      });
  }, []);

  return (
    <>
      {data.length>0 &&
        <List items={data}/>
      }
    </>
  );
}

export default App;
